import React from "react";
import Header from "./backDash/Nav";
import DashProducts from "./backDash/DashProducts";
import Home from "./backDash/Home";
import Contact from "./backDash/Contact";
import DashCart from "./backDash/DashCart";
import { BrowserRouter as Router, Route } from "react-router-dom";

function Main() {
  return (
    <Router>
      <div>
        <Header />
        <section>
          <Route path="/" component={Home} exact />
          <Route path="/DashProducts" component={DashProducts} exact />
          <Route path="/Contact" component={Contact} exact />
          <Route path="/DashCart" component={DashCart} exact />
        </section>

        <Home />
        <DashProducts />
        <Contact />
        <DashCart />
      </div>
    </Router>
  );
}

export default Main;
